CREATE TABLE IF NOT EXISTS `credenciales`
 ( 
`clave_excaja` TEXT DEFAULT NULL, 
`clave_tipo` INT(11) unsigned DEFAULT NULL, 
`clave_numero` INT(11) unsigned DEFAULT NULL, 
`clave_coparticipe` TEXT DEFAULT NULL, 
`clave_parentesco` TEXT DEFAULT NULL, 
`leyaplicada` VARCHAR(255) DEFAULT NULL, 
`apenom` VARCHAR(255) DEFAULT NULL, 
`sexo` VARCHAR(255) DEFAULT NULL, 
`estcivil` INT(11) unsigned DEFAULT NULL, 
`tipo_doc` VARCHAR(255) DEFAULT NULL, 
`numero_doc` INT(11) unsigned DEFAULT NULL, 
`fenac` VARCHAR(255) DEFAULT NULL, 
`dom_calle` VARCHAR(255) DEFAULT NULL, 
`dom_nro` VARCHAR(255) DEFAULT NULL, 
`dom_piso` INT(11) unsigned DEFAULT NULL, 
`dom_dpto` VARCHAR(255) DEFAULT NULL, 
`cod_pos` INT(11) unsigned DEFAULT NULL, 
`depto` VARCHAR(255) DEFAULT NULL, 
`conca` VARCHAR(255) DEFAULT NULL, 
`localidad` VARCHAR(255) DEFAULT NULL, 
`hospital` VARCHAR(255) DEFAULT NULL
) 
ENGINE=MyISAM DEFAULT CHARSET=utf8; 



